import React from "react";

const getRandomRotation = () => Math.floor(Math.random() * 360);
const getRandomScale = () => 0.8 + Math.random() * 0.2;

const Petal = () => (
  <div
    className="petal"
    style={{
      "--rotation": `${getRandomRotation()}deg`,
      "--scale": getRandomScale(),
    }}
  />
);

export default () => (
  <div className="birthdayCard">
    <div className="cardFront">
      <div className="happy">Happy Birthday!</div>
      <div className="sunflower">
        <div className="sunflowerCenter"></div>
        <div className="petals">
          <Petal />
          <Petal />
          <Petal />
          <Petal />
          <Petal />
          <Petal />
          <Petal />
          <Petal />
        </div>
        <div className="stem"></div>
        <div className="leaf left"></div>
        <div className="leaf right"></div>
      </div>
    </div>
  </div>
);
